=head1 DESCRIPTION

Indicates whether DataSync created a complete task report
(https://docs.aws.amazon.com/datasync/latest/userguide/task-reports.html)
for your transfer.

=head1 ATTRIBUTES


=head2 ErrorCode => Str

Indicates the code associated with the error if DataSync can't create a
complete report.


=head2 ErrorDetail => Str

Provides details about issues creating a report.


=head2 Status => Str

Indicates whether DataSync is still working on your report, created a
report, or can't create a complete report.



